import { useEffect, useState } from "react"
import axios from "axios"

function DataFetching() {
    const [income, setIncome] = useState([])
    const [error, setError] = useState()

    useEffect(() => {
        axios
            .get('http://localhost:3000/income_widget')
            .then(res => {
                console.log(res)
                setIncome(res.data)
            })
            .catch (err => {
                console.log(err)
                setError(err)

            })
    },[])

    return (
    <div>
        <ul>
            {income.map(inc => (
            <li key={inc.incomeType}>{inc.incomeType}{inc.amount}</li>
            ))}
        </ul>
        <p>{error}</p>
    </div>
  )
}

export default DataFetching
